On this stunning audio edition of the national PBS special with Caroline Myss, this acclaimed authority on the energetics of healing dares to take listeners to a hidden realm of the human body, beyond Western myths about healing-yielding a hope-giving program for health unlike any other. For over 15 years, Caroline Myss has worked face to face with the real experts on this controversial subject: thousands of people challenged by illnesses who failed to respond to conventional treatment. As a medical intuitive, Myss saw beyond their physical complaints-and identified the greatest block to healing in our culture today. She shows that when we stop using illness as a way to gain power and intimacy with others, we stop wasting our sacred energy. It then becomes available, not only for self-healing, but for spiritual fulfillment. Here is a bold new vision of healing, presented by Caroline Myss in her own words, that will electrify you with its unlimited possibilities for improved health and spiritual connection. Includes an exclusive interview with Caroline Myss.
